import React from 'react';
import { useNavigate } from 'react-router-dom';
import styled from 'styled-components';

export const TheFooter = () => {
  const navigate = useNavigate();

  return (
    <Buttons>
      <Button onClick={() => navigate('/')}>
        <img src='/images/footer/home.png' alt='logo' />
        홈</Button>
      <Button onClick={() => navigate('/stage')}>공연</Button>
      <Button onClick={() => navigate('/booth')}>거리문화제</Button>
      <Button onClick={() => navigate('/foodTruck')}>푸드트럭</Button>
      <Button onClick={() => navigate('/information')}>정보</Button>
    </Buttons>
  );
};

const Buttons = styled.div`
  background-color: #fafafa;
  display: flex;
  justify-content: center;
`;

const Button = styled.button`
  background-color: #fafafa;
  color: #6a7282;
  border: none;
  padding: 10px 20px;
  margin: 0 10px;
  cursor: pointer;
`;
